<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Document</title>
  <meta
    http-equiv="X-UA-Compatible"
    content="IE=edge,chrome=1"
  />
  <meta
    name="description"
    content="Description"
  >
  <meta
    name="viewport"
    content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0"
  >
  <link
    href="//unpkg.com/docsify/lib/themes/vue.css"
    rel="stylesheet"
  >
</head>
<body>
<input
  class="test"
  id="app"
  name="test"
  src="./test.png"
  type="text"
  title="test"
  data-name="ranwawa"
  aria-activedescendant="test"
  data-age="25"
/>
<script>
window.$docsify = {
  el: '#app',
  repo: 'ranwawa/docs',
  maxLevel: 6,
  loadNavbar: true,
  loadSidebar: true,
  subMaxLevel: 4,
  auto2top: true,
  homepage: 'README.md',
  relativePath: true,
  coverpage: true,
  logo: '/_media/log.png',
  name: 'engis',
  nameLink: '/',
  themeColor: '#000',
  autoHeader: true,
  executeScript: true,
  noEmoji: false,
  mergeNavbar: false,
  formatUpdated: '{YYYY}/{MM}/{DD} {HH}:{mm}',
  externalLinkTarget: '_self',
  routerMode: 'hash',
  notFoundPage: true,
  search: {
    maxAge: 86400000,
    paths: 'auto',
    placeholder: '输入关键词,冉娃娃帮你找',
    noData: '哎呀--|||没有找到相关内容,换个关键词试试',
    depth: 6,
  },
};
</script>
<script src="//unpkg.com/docsify/lib/docsify.min.js"></script>
<script src="//unpkg.com/docsify/lib/plugins/search.min.js"></script>
<script src="//unpkg.com/docsify/lib/plugins/zoom-image.min.js"></script>
<script src="//unpkg.com/docsify-copy-code"></script>
<script src="//unpkg.com/docsify-pagination/dist/docsify-pagination.min.js"></script>

</body>
</html>
